import React from "react";
import FileDropdown from "./components/Menu";
import SideBar from "./components/sidebar/SideBar";
import PopupForm from "./components/sidebar/TestAgain";

function App() {
  return(
      <div style={{marginLeft: '20px', marginTop: '20px'}}>
        <PopupForm />
        <FileDropdown/>
        <SideBar />
      </div>
  );
}

export default App;
